{"4": ["Хорошо держит, лёгкая с пружиной внутри. Рекомендую ", "2021-05-09T09:19:22Z", "", "0", 1, 0, 5, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "6": ["Карниз пришел в ненарушенной упаковке, с полным комплектом (хотя кольца мне не нужны). Установить легко сможет даже тот, у кого руки растут не оттуда (я про себя). Главное, строго следовать инструкции или посмотреть видео по интернету. Пока все супер, держится крепко. Спасибо производителю за такой легкий способ установки!", "2021-05-08T04:47:29Z", "", "0", 1, 0, 5, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "7": ["Сломался при установке, пружина не держит, все развалилось ", "2021-05-07T19:52:27Z", "", "0", 0, 1, 1, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "8": ["Карниз хороший", "2021-05-07T17:17:16Z", "", "0", 1, 0, 5, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "11": ["Пришёл не гнутый, нормальный за 356р", "2021-05-06T14:22:25Z", "", "0", 1, 0, 5, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "14": ["Всё супер!\nПолный комплект, установливается крепко.", "2021-05-05T00:18:37Z", "", "0", 0, 1, 5, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "15": ["Доставили сломанный и в вскрытой упаковке карниз, возврат ", "2021-05-04T12:41:43Z", "", "0", 1, 0, 1, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "20": ["Заказала одновременно 2, но чудесный Вайлдберриз снова разделил доставку, в итоге первый карниз получила уже через 2 дня, а второй жду вторую неделю....не приятно", "2021-05-02T08:36:53Z", "", "0", 2, 0, 3, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "33": ["Оценить качество карниза не представляется возможным, в виду отсутствия такового. Вместо заказанного карниза прислали органайзер для столовых приборов (в кухонный шкаф).  Самое  интересное - это не ошибка сборщика. Номер от моего карниза проставлен на органайзере для столовых приборов. Судя по этому все кто повторит мой заказ, получит не то что хотелось бы (случай в Ростове-на-Дону).  Заказ не забрала, прошу не учитывать в проценте выкупа.  ", "2021-04-27T16:05:37Z", "", "0", 0, 1, 1, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "36": ["Отвратительный карниз, весь в дефектах и царапина, ещё и упаковка было вскрыта, такое ощущение что им уже пользовались, ещё и не было одной резиночки на конце пришлось ластик запихать, а то падал. Страшно было раздвигать как будто сломается. Но оставила на первое время, долго ждала. К покупке совсем не советую.", "2021-04-25T09:01:36Z", "", "0", 2, 0, 1, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "37": ["Установила без проблем, за 2 минуты. Пришел товар в отличном состояние, хорошо упакован, все в целости", "2021-04-25T08:49:24Z", "", "0", 1, 0, 5, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "38": ["Хороший карниз!", "2021-04-24T07:47:24Z", "", "0", 1, 0, 5, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "39": ["Деталь имеет брак, царапины, и дефекты. Установили в ванную, за занавеской не видно, но они есть.", "2021-04-22T18:23:11Z", "", "0", 1, 0, 3, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "42": ["Палка просто супер!@!", "2021-04-21T11:20:26Z", "", "0", 1, 0, 5, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "43": ["Пришел карниз с дефе