 см.", "VIOLET"], "83": ["Не соответствует описанию. Ванная комната 2м 8 см, но карниз выдвинут на всю длину прогнутый и не держится, так как слабая пружина. На максимальную длину 210 см он не рассчитан, максимум на 180 он ещё будет способен держаться. Так же упаковка вся разорвана, хорошо, что ни чего не потерялось.", "2021-04-02T09:31:01Z", "", "0", 4, 0, 1, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "84": ["Не соответствует описанию, заказывала с прозрачными креплениями и кольцами, пришли серого цвета, все целое, но с цветом огорчили ", "2021-04-02T08:04:45Z", "серебристый", "0", 1, 0, 3, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "87": ["Отличный карниз, единственное заказывала серебряный с прозрачными кольцами, а пришел с серыми... немного огорчило. Установили за 3 минуты) ", "2021-04-01T13:17:00Z", "серебристый", "0", 1, 0, 5, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "89": ["Ужас!!! Вместо карниза пришло 5 колец в рваном пакете! ", "2021-03-31T15:47:13Z", "", "0", 1, 0, 1, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "91": ["Отличный карниз -прекрасно выполняет свою функцию. Не очень понравились серые кольца - исползовала те, что прилагались к шторе. Большое спасибо за качественный товар и быструю доставку! (До этого купила карниз на местном строительном рынке аж за 1000руб - думала, быстрее будет... а он быстро сломался, что то с пружиной внутри, не раздвигается...)", "2021-03-31T07:28:55Z", "серебристый", "0", 3, 0, 5, "Карниз раздвижной для занавески в ванную, в комплекте с кольцами, шириной от 120 до 210 см.", "VIOLET"], "92": ["Заказывала с прозрачными наконечниками и кольцами, прислали с серыми и небольшая вмятина. Упаковка была повреждена. Убедительная просьба, если производитель изменил дизайн карниза, ис